		matrix[6] = matrix[9];
		matrix[9] = temp;

		temp = matrix[3];
		matrix[3] = matrix[12];
		matrix[12] = temp;

		temp = matrix[7];
		matrix[7] = matrix[13];
		matrix[13] = temp;

		temp = matrix[11];
		matrix[11] = matrix[14];
		matrix[14] = temp;
