	// Determine if chunk should be visible
	var chunkVisible = function (x, y, z, maxY) {
		x -= 0.5;
		y -= 0.5;
		z -= 0.5;
		maxY += 0.5;
		var px = 0,
			py = 0,
			pz = 0,
			plane = null;
		var cx = p.x,
			cy = p.y,
			cz = p.z;
		for (var i = 0; i < 4; i++) {
			plane = p.frustum[i];
			px = x + plane.dx;
			py = plane.dy ? maxY : y;
			pz = z + plane.dz;
			if ((px - cx) * plane.nx + (py - cy) * plane.ny + (pz - cz) * plane.nz < 0) {
				return false;
			}
		}
		return true;
	};

