						chunk.setBlock(i, gen - 3, k, (gen - 3 > 94 ? blockIds.packedIce : (subbiome == "dotted_mountains" ? choice([blockIds.stone, blockIds.stone,blockIds.tuff, blockIds.andesite]) : blockIds.stone)));
