	var controls = function () {
		move.x = 0;
		move.z = 0;
		var dt = (win.performance.now() - p.lastUpdate) / 33;
		dt = dt > 2 ? 2 : dt;
		if (Key.w) {
			move.z += p.speed;
		}
		if (Key.s) {
			move.z -= p.speed;
		}
		if (Key.a) {
			move.x += p.speed;
		}
		if (Key.d) {
			move.x -= p.speed;
		}
		if (p.flying) {
			if (Key[" "]) {
				p.velocity.y += 0.06 * dt;
			}
			if (Key.shift) {
				p.velocity.y -= 0.06 * dt;
			}
		}
    else if (inLiquid(p.x, p.y, p.z)) {
      if (Key[" "]) {
        p.velocity.y = 0.25
			}
    }
		else if (inSnow(p.x, p.y, p.z)) {
      if (Key[" "]) {
        p.velocity.y = 0.05
			}
    }
    else if (canClimb(p.x, p.y, p.z)) {
      if (Key[" "]) {
        p.velocity.y = 0.15
			}
      if (Key.shift) {
				p.velocity.y -= 0.06 * dt;
			}
    }
		if (Key.arrowleft) {
			p.ry -= 0.1 * dt;
		}
		if (Key.arrowright) {
			p.ry += 0.1 * dt;
		}
		if (Key.arrowup) {
			p.rx += 0.1 * dt;
		}
		if (Key.arrowdown) {
			p.rx -= 0.1 * dt;
		}
		if (Key.q) {
			p.sprinting = true;
		}
		if (p.sprinting) {
			move.x *= p.sprintSpeed;
			move.z *= p.sprintSpeed;
		}
		if (p.flying) {
			move.x *= p.flySpeed;
			move.z *= p.flySpeed;
		}
		if (!move.x && !move.z) {
			p.sprinting = false;
		} else if (Math.abs(move.x) > 0 && Math.abs(move.z) > 0) {
			move.x *= move.ang;
			move.z *= move.ang;
		}
		// Update the velocity
		var co = Math.cos(p.ry);
		var si = Math.sin(p.ry);
		var friction = p.onGround ? 1 : 0.3;
		p.velocity.x += (co * move.x - si * move.z) * friction * dt;
		p.velocity.z += (si * move.x + co * move.z) * friction * dt;

		while (p.ry > Math.PI * 2) {
			p.ry -= Math.PI * 2;
		}
		while (p.ry < 0) {
			p.ry += Math.PI * 2;
		}
		if (p.rx > Math.PI / 2) {
			p.rx = Math.PI / 2;
		}
		if (p.rx < -Math.PI / 2) {
			p.rx = -Math.PI / 2;
		}

		p.direction.set(-si * Math.cos(p.rx), Math.sin(p.rx), co * Math.cos(p.rx));
		computeFrustum();
	};

